- book_title: Psalms
  book_usfm_code: PSA
  chapter_number: '92'
  iso-639-2_language_code: eng
  verse_number: '1'
  verse_text: The Praise of a Canticle, of David himself. In the time before the Sabbath,
    when the earth was founded.
- book_title: Psalms
  book_usfm_code: PSA
  chapter_number: '92'
  iso-639-2_language_code: eng
  verse_number: '2'
  verse_text: The Lord has reigned. He has been clothed with beauty.
- book_title: Psalms
  book_usfm_code: PSA
  chapter_number: '92'
  iso-639-2_language_code: eng
  verse_number: '3'
  verse_text: The Lord has been clothed with strength, and he has girded himself.
    Yet he has also confirmed the world, which will not be moved.
- book_title: Psalms
  book_usfm_code: PSA
  chapter_number: '92'
  iso-639-2_language_code: eng
  verse_number: '4'
  verse_text: My throne is prepared from of old. You are from everlasting.
- book_title: Psalms
  book_usfm_code: PSA
  chapter_number: '92'
  iso-639-2_language_code: eng
  verse_number: '5'
  verse_text: The floods have lifted up, O Lord, the floods have lifted up their voice.
    The floods have lifted up their waves,
- book_title: Psalms
  book_usfm_code: PSA
  chapter_number: '92'
  iso-639-2_language_code: eng
  verse_number: '6'
  verse_text: before the noise of many waters. Wondrous are the surges of the sea;
    wondrous is the Lord on high.
- book_title: Psalms
  book_usfm_code: PSA
  chapter_number: '92'
  iso-639-2_language_code: eng
  verse_number: '7'
  verse_text: Your testimonies have been made exceedingly trustworthy. Sanctity befits
    your house, O Lord, with length of days.
